import React from 'react';
import '../css/productpage.css';
import HomeHeader from '../subpages/HomeHeader';
import sonyWirelessHeadphones from '../images/sonywirelessheadphones.jpeg';
const ProductPage = () => {
  return (
    <div className="product-container">
      <HomeHeader />
      <div className="product-body">
        <div className="product-left">
          <img src={sonyWirelessHeadphones} alt="Headphone" />
          <input type="button" placeholder="Share" value="Share" />
        </div>
        <div className="product-right"></div>
      </div>
    </div>
  );
};

export default ProductPage;
